node.text:
Mission accomplished: #TheWorldAdventureWeek saw riders from every part of the world hit the open road.

Some impressive riding stats:
// 1.5 million kilometers ridden
// 25,000 riding hours in total
// 4,770 m, the highest altitude ridden
// 735 group rides completed
// 74 countries where rides took place

With close to 1000 riders entering the draw for the weekly prize, the lucky winner who will ride away on a KTM 1290 SUPER ADVENTURE S is Glenn V. from Norway.

Check out the link in bio for the daily prize winners and the interactive social media wall.

#ReadyToRace #TheWorldAdventureWeek #GoAdventure
